#include <FC/math/Kalman.h>
#include <FC/control/AnalogSensors.h>
#include <stmos/peripherals/USART.h>
#include <stmos/util/Task.h>
#include <math.h>

using namespace stmos;
using namespace FC;

USART out(1, 115200);

Kalman::Config config = { // roll_pitch_kalman
	{ // Q
		1E-10, 1E-7, 0,
		1E-7, 1E-4, 0,
		0, 0, 1E-12,
	}, { // R
		6.7716e-4, -4.8451e-4,
		-4.8451e-4, 3.9255e-3,
	}
};

Kalman kalman(config);
extern const AnalogSensors::Readings readings[1954];

static inline float sqr(float f) { return f*f; }

int main(int argc, char **argv) {		
	int i;
	for (i=0; i<10; i++) {	
		const AnalogSensors::Readings &reading = readings[i];
		float g = sqrtf(sqr(reading.x_accel) + sqr(reading.y_accel) + sqr(reading.z_accel));
		float apitch = -asinf(reading.y_accel / g);
		float aroll = -asinf(reading.x_accel / (cosf(apitch)*g));

		kalman.step((Kalman::Measurement) {{aroll, reading.roll_gyro}});
	
		Kalman::State state = kalman.getState();
		int j;
		for (j=0; j<3; j++)
			out.printf("%f ", state.vec[j]);
		out.print("\n");
	}
}

